const TimelineDisplayer=function(tag_id,timeline_el,canvas){const events_list_el=document.querySelector(`#${tag_id} > .timeline-events`);this.timelineObj={start_year:parseInt(timeline_el.dataset.start),end_year:parseInt(timeline_el.dataset.end),events:[],style:{},functions:{timeline:{},events:{}}};const TL=this.timelineObj;TL.functions.timeline.getStyle=function(){const compStyles=getComputedStyle(timeline_el);TL.style.background_color=compStyles.getPropertyValue("--background-color")}};window.timelineDom=[];window.timelineDisplay=function(tag_id){const timeline_el=document.getElementById(tag_id),canvas_el=document.createElement("canvas");canvas_el.className="timeline-canvas-el";canvas_el.style.width="100%";canvas_el.style.height="100%";const canvas=timeline_el.appendChild(canvas_el);if(canvas!=null){timelineDom.push(new TimelineDisplayer(tag_id,timeline_el,canvas))}};timelineDisplay("timeline");